import React from 'react'

const Profile = (props) => {
    if (!props.profile) {
        return (
            <h3>Loading...</h3>
        )
    }

    return (
        <div>

                        <div>Name: {profile.name.toUpperCase()}</div>
                        <div>ID: {profile.id}</div>
                        <div>Caught: {profile.isCaught}</div>

                        <img src={`/pokemons/${profile.id}.png`} className="rounded mx-auto d-block" alt="image" />





        </div>
    )
}

export default Profile;
